<div id="rwnkmg-popup-box-preview-{{num}}" class="popupally-pro-outer-preview-rwnkmg-{{num}} popupally-pro-outer-preview-background-rwnkmg-{{num}}">
	<div class="popupally-pro-inner-rwnkmg-{{num}}">
		<div popupally-preview-linked="rwnkmg-config-image-1-{{num}}" class="image-1-pro-rwnkmg rwnkmg-preview-image-1-{{num}}" id="rwnkmg-preview-image-1-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-image-2-{{num}}" class="image-2-pro-rwnkmg rwnkmg-preview-image-2-{{num}}" id="rwnkmg-preview-image-2-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-headline-{{num}}" class="desc-pro-rwnkmg rwnkmg-preview-headline-{{num}}" id="rwnkmg-preview-headline-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-textbox-1-{{num}}" class="textbox-1-pro-rwnkmg rwnkmg-preview-textbox-1-{{num}}" id="rwnkmg-preview-textbox-1-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-textbox-2-{{num}}" class="textbox-2-pro-rwnkmg rwnkmg-preview-textbox-2-{{num}}" id="rwnkmg-preview-textbox-2-{{num}}"></div>
		<input popupally-preview-linked="rwnkmg-config-name-input-{{num}}" type="text" id="rwnkmg-preview-name-{{num}}" name="name" {{rwnkmg-preview-hide-name}} class="field-pro-rwnkmg-name rwnkmg-preview-name-{{num}}" placeholder="{{rwnkmg-name-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-lname-input-{{num}}" type="text" id="rwnkmg-preview-lname-{{num}}" name="lname" {{rwnkmg-preview-hide-lname}} class="field-pro-rwnkmg-lname rwnkmg-preview-lname-{{num}}" placeholder="{{rwnkmg-lname-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-email-input-{{num}}" type="email" id="rwnkmg-preview-email-{{num}}" name="email" class="field-pro-rwnkmg-email rwnkmg-preview-email-{{num}}" placeholder="{{rwnkmg-email-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-subscribe-button-{{num}}" type="button" id="rwnkmg-subscribe-button-{{num}}" class="submit-pro-rwnkmg no-click-through rwnkmg-subscribe-button-{{num}}" value="{{rwnkmg-subscribe-button-text}}"/>
	</div>
</div>